func GetCaseRelaBoxVo(uniqueKey string) *CaseRelaBoxVo {

	for k, v := range CaseRelaBoxConfigs {
		if v.UniqueKey == uniqueKey {
			return CaseRelaBoxConfigs[k]
		}
	}
	return nil
}

