const BoxSign_status = "converting"

// IsBoxSignStatusFinishSigned 是否已签名
func IsBoxSignStatusFinishSigned(status string) bool {
	if status == "signed" {
		return true
	}
	return false
}

// IsBoxSignStatusFinalizing 是否为最终状态
func IsBoxSignStatusFinalizing(status string) bool {
	if status == "cancelled" ||
		status == "declined" ||
		status == "error_converting" ||
		status == "error_sending" ||
		status == "expired" ||
		status == "finalizing" ||
		status == "error_finalizing" {
		return true
	}
	return false
}

